import React, { useState, useContext } from 'react';
import { Link } from 'react-router-dom';
import AuthContext from '../context/AuthContext';
import './Navbar.css';

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  return (
    <nav className="navbar">
      <div className="container">
        <div className="navbar-content">
          <Link to="/" className="navbar-brand" onClick={closeMenu}>
            <div className="brand-content">
              <img 
                src="https://git-india.edu.in/wp-content/uploads/2025/06/GIT-logo-new-1024x271.jpg" 
                alt="GIT Logo" 
                className="brand-logo"
              />
            </div>
          </Link>
          <button className="hamburger" onClick={toggleMenu} aria-label="Toggle menu">
            <span className={isMenuOpen ? 'hamburger-line open' : 'hamburger-line'}></span>
            <span className={isMenuOpen ? 'hamburger-line open' : 'hamburger-line'}></span>
            <span className={isMenuOpen ? 'hamburger-line open' : 'hamburger-line'}></span>
          </button>
          <div className={`navbar-links ${isMenuOpen ? 'active' : ''}`}>
            <Link to="/" className="nav-link" onClick={closeMenu}>Home</Link>
            {user ? (
              <>
                <Link to="/dashboard" className="nav-link" onClick={closeMenu}>Dashboard</Link>
                {user.userType === 'admin' && (
                  <Link to="/admin" className="nav-link" onClick={closeMenu}>Admin Panel</Link>
                )}
                <Link to="/profile" className="nav-link" onClick={closeMenu}>Profile</Link>
                <button onClick={() => { logout(); closeMenu(); }} className="nav-link btn-logout">Logout</button>
              </>
            ) : (
              <>
                <Link to="/register" className="nav-link" onClick={closeMenu}>Register User</Link>
                <Link to="/login" className="nav-link" onClick={closeMenu}>Sign In</Link>
              </>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
